import React from 'react';
import {states} from './statesArray';

const select = `<select name="states" id="states">
states.forEach(element => {
    <option value= {element}>{element}</option>
});
</select>`
export const DropDown = () =>{
    return(
        <div>
            {select}
        </div>
    );
}
